  true,\n\t\"url\": null,\n\t\"notes\": \"The National Reporting System for Adult
  Education, 2012-13 (NRS 2012-13), is part of the Adult Education and Family Literacy
  program; program data is available since 1997 at <http://www.nrsweb.org>. NRS 2012-13
  (http://www.nrsweb.org) is a cross-sectional study that was designed to monitor
  performance accountability for the federally funded, state-administered adult education
  program. States were required to submit their progress in adult education and literacy
  activities by reporting data on core indicators of outcomes on all adult learners
  who receive 12 or more hours of service as well as state expenditures on the adult
  education program. States could also report on additional, optional secondary measures
  that included outcomes related to employment, family, and community. The study was
  conducted using a web-based reporting system of states. NRS 2012-13 is a universe
  survey, and all states submitted data. Key statistics produced from the study include
  student demographics, receipt of secondary school diploma or general education development
  (GED) certificate, placement in postsecondary education or training, educational
  gain, and employment placement and retention.\",\n\t\"license_title\": \"Creative
